import React from 'react';
import CartItem from './CartItem'
const Cart = (props) => {
  return (
    <div>
    Cart
      {props.items.map( (item)=> <CartItem
        key={item.id}
        name={item.name}
        description={item.description}
        price={item.price} />)}
    </div>
  )
}

export default Cart;
